provisions.content:
Pripažinti netekusiais galios:

1) Lietuvos Respublikos įstatymą „Dėl Tarnybos Lietuvos Respublikos prokuratūroje statuto patvirtinimo“ (Žin., 1995, Nr. 15-345);

2) Lietuvos Respublikos tarnybos Lietuvos Respublikos prokuratūroje statuto papildymo 69-1 straipsniu įstatymą (Žin., 2001, Nr. 39-1339);

3) Lietuvos Respublikos valstybės kontrolės įstatymo, Teismų įstatymo, Konstitucinio Teismo įstatymo, Seimo kontrolierių įstatymo, Seimo narių darbo sąlygų įstatymo, Prokuratūros įstatymo, Tarnybos Lietuvos Respublikos prokuratūroje statuto, Moterų ir vyrų lygių galimybių įstatymo, Vaiko teisių apsaugos kontrolieriaus įstatymo pakeitimo ir papildymo įstatymo septintąjį skirsnį (Žin., 2001, Nr. 64-2328).
